import { nanoid } from "nanoid";

export default function RowObject (rawRows) {
    const gameRows = [];
    rawRows.map(row=>{
        row.map(square=>{
            if(square=== true) {
                gameRows.push({value:true, id:"square-"+nanoid()});
            } else {
                gameRows.push({value:false, id:"square-"+nanoid()});
            }
        })
    });
    console.log(gameRows);
    // return gameRows;
}
